import React from 'react';
import { Link } from 'react-router-dom';

function Hero() {
  return (
    <section className="hero">
      <h1>Find Your Right Career Path With Confidence</h1>
      <Link to="/signup"><button className="btn">Get Started</button></Link>
      <Link to="/"><button className="btn">Explore Stories</button></Link>
    </section>
  );
}

export default Hero;
